const StyledButton = styled.button`

  padding: 10px 30px;
  background-color: transparent;
  border-radius: 30px;
  background: linear-gradient(90deg, var(--Jaune-Clair) 0%, var(--Jaune-Orange) 50%, var(--Rose-Fonce) 80%, var(--Fuschia) 100%);
  color: white;

`

export default StyledButton
